    display: "flex",
    justifyContent: "center",
    gap: "1rem",
    flexWrap: "wrap",
  },
  link: {
    textDecoration: "none",
  },
  button: {
    padding: "0.85rem 2rem",
    fontSize: "1.1rem",
    borderRadius: "30px",
    cursor: "pointer",
    display: "flex",
    alignItems: "center",
    gap: "0.5rem",
    transition: "all 0.3s ease",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.15)",
    fontWeight: "600",
    letterSpacing: "0.5px",
  },
  primaryButton: {
    backgroundColor: "#28a745",
    color: "white",
    border: "none",
    ":hover": {
      backgroundColor: "#218838",
      transform: "translateY(-2px)",
    },
  },
  secondaryButton: {
    backgroundColor: "#ffc107",
    color: "#212529",
    border: "none",
    ":hover": {
      backgroundColor: "#e0a800",
      transform: "translateY(-2px)",
    },
  },
  buttonIcon: {
    fontSize: "1.2rem",
  },
  features: {
    maxWidth: "1200px",
    margin: "4rem auto",
    padding: "2rem",
  },
  featuresTitle: {
    textAlign: "center",
    fontSize: "2.5rem",
    fontWeight: "700",
    marginBottom: "3rem",
    color: "#2c3e50",
  },
  featuresGrid: {
    display: "grid",
    gridTemplateColumns: "repeat(auto-fit, minmax(300px, 1fr))",
    gap: "2rem",
  },
  featureCard: {
    backgroundColor: "white",
    borderRadius: "12px",
    padding: "2rem",
    boxShadow: "0 5px 15px rgba(0, 0, 0, 0.1)",
    transition: "all 0.3s ease",
    textAlign: "center",
    ":hover": {
      transform: "translateY(-5px)",
      boxShadow: "0 10px 25px rgba(0, 0, 0, 0.2)",
